				mean([program.analysis.Nodes(program.analysis.ElementNodeIds(:,i), 1), program.analysis.Nodes(program.analysis.ElementNodeIds(:,j), 1), program.analysis.Nodes(program.analysis.ElementNodeIds(:,k), 1)],2), ...
